import React from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import UserService from '../service/UserService';

function Navbar() {
    const isAuthenticated = UserService.isAuthenticated();
    const isAdmin = UserService.isAdmin();
    const navigate = useNavigate();

    const handleLogout = () => {
        const confirmDelete = window.confirm('Are you sure you want to logout this user?');
        if (confirmDelete) {
            UserService.logout();
            navigate('/');
        }
    };

    return (
        <nav>
            <ul>
                {/* Home link */}
                {!isAuthenticated && (
                    <li>
                        <NavLink to="/" activeClassName="active-link" exact>
                            E-Commerce Website
                        </NavLink>
                    </li>
                )}

                {/* Profile link */}
                {isAuthenticated && (
                    <li>
                        <NavLink to="/profile" activeClassName="active-link">
                            Profile
                        </NavLink>
                    </li>
                )}

                {/* Admin Product Section */}
                {isAdmin && isAuthenticated && (
                    <li>
                        <NavLink to="/auth/product-add" activeClassName="active-link">
                            Product Section
                        </NavLink>
                    </li>
                )}

                {/* Product List */}
                {isAuthenticated && (
                    <li>
                        <NavLink to="/auth/all-products" activeClassName="active-link">
                            Product List
                        </NavLink>
                    </li>
                )}

                {/* User's Product List */}
                {isAuthenticated && (
                    <li>
                        <NavLink to="/product-list" activeClassName="active-link">
                            Our Products
                        </NavLink>
                    </li>
                )}

                {/* Admin User Management */}
                {isAdmin && (
                    <li>
                        <NavLink to="/admin/user-management" activeClassName="active-link">
                            User Management
                        </NavLink>
                    </li>
                )}

                {/* Logout */}
                {isAuthenticated && (
                    <li>
                        <NavLink to="/" onClick={handleLogout} activeClassName="active-link">
                            Logout
                        </NavLink>
                    </li>
                )}
            </ul>
        </nav>
    );
}

export default Navbar;
